import React, { useContext, useEffect, useState } from 'react';
import './singleUserCall.css'
import { ContextProvider, SocketContext } from '../../Context.js'
import Sidebar from './Sidebar';
import Notifications from './Notifications';
import ConferencePage from './ConferencePage.jsx';

const SingleUserCall = () => {
  const context = useContext(SocketContext)
  console.log(context)
  const { name, callAccepted, myVideo, userVideo, callEnded, stream, call } = context
  console.log(stream)
  return (
    <ContextProvider>
      <div>
        <div className="wrapper">
          <div className="appBar" position="static" color="inherit">
            <h2>Video Chat</h2>
          </div>

          <ConferencePage />
          <Sidebar>
            <Notifications />
          </Sidebar>
        </div>
      </div>
    </ContextProvider>
  )
}

export default SingleUserCall
